import './ExpenseItem.css';

function ExpenseItem(props) { // props holds all received attributes as properties 
    const month = props.date.toLocaleleString('en-Us', { month: 'long'});
    // const day = props.date.toLocaleleString('en-Us', { day: '2-digit'});
    // const year = props.date.getFullYear();
    // <div>{props.date.toISOString()}</div>
    return (
        <div className="expense-item">
            <div className="expense-item__dexcription">
              <h2>{props.title}</h2>
              <div className="expense-item__price">${props.amount}</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
